import './Login.css'

const Login =() =>{
    return(
        <div className="box-container">
            <form className="box">
                <h2 className="">Hi User</h2>
                <input type="text" placeholder="Username"/>
                <input type="password" placeholder="Password"/>
                <button type="submit" >Login</button>
            </form>

        </div>
    )
}

export default Login
